--
-- Table structure for table `nm_empleados`
--

DROP TABLE IF EXISTS `nm_empleados`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `nm_empleados` (
  `usuario` varchar(15) NOT NULL COMMENT 'Usuario',
  `fecha_ingreso` date NOT NULL COMMENT 'Fecha ingreso',
  `fecha_retiro` date DEFAULT NULL COMMENT 'Fecha retiro',
  `id_estado` int(11) NOT NULL COMMENT 'Estado',
  `numid` varchar(20) NOT NULL COMMENT 'Identificación',
  `id_cargo` varchar(10) NOT NULL COMMENT 'Cargo',
  `id_nivel` int(11) NOT NULL COMMENT 'Nivel',
  `contrato` int(11) NOT NULL,
  `cesantias` int(11) NOT NULL,
  `pension` int(11) NOT NULL,
  `eps` int(11) NOT NULL,
  `codemple` varchar(15) NOT NULL COMMENT 'Código empleado',
  PRIMARY KEY (`codemple`),
  KEY `fk_cargoe` (`id_cargo`),
  KEY `fk_numide` (`numid`),
  CONSTRAINT `fk_cargoe` FOREIGN KEY (`id_cargo`) REFERENCES `np_cargos` (`id_cargo`),
  CONSTRAINT `fk_numide` FOREIGN KEY (`numid`) REFERENCES `nm_nits` (`numid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Empleados';
/*!40101 SET character_set_client = @saved_cs_client */;

