  CONSTRAINT `fk_clase` FOREIGN KEY (`idclase`) REFERENCES `np_tiponit` (`idclase`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Nits';
