--
-- Table structure for table `nm_sucursal`
--

DROP TABLE IF EXISTS `nm_sucursal`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `nm_sucursal` (
  `id_sucursal` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `numid` varchar(20) NOT NULL COMMENT 'Identificación',
  `orden` int(11) NOT NULL COMMENT 'Orden',
  `direccion` varchar(200) NOT NULL COMMENT 'Dirección',
  `telefono` varchar(20) NOT NULL COMMENT 'Teléfono',
  `telefono2` varchar(20) NOT NULL COMMENT 'Teléfono dos',
  `fax` varchar(20) NOT NULL COMMENT 'Fax',
  `ciudad` varchar(20) NOT NULL,
  `pais` int(11) NOT NULL COMMENT 'País',
  `nom_sucur` varchar(30) NOT NULL COMMENT 'Nombre de sucursal',
  `suc_lat_gps` varchar(20) NOT NULL COMMENT 'Latitud',
  `suc_lng_gps` varchar(20) NOT NULL COMMENT 'Longitud',
  `cod_clie_helisa` varchar(20) NOT NULL COMMENT 'Código Cliente Helisa',
  `cod_prv_helisa` varchar(20) NOT NULL COMMENT 'Código Proveedor Helisa',
  `estado` tinyint(1) NOT NULL DEFAULT 1 COMMENT 'Estado',
  `id_region` varchar(20) NOT NULL COMMENT 'Región',
  PRIMARY KEY (`id_sucursal`),
  KEY `fk_idciudads` (`ciudad`),
  KEY `fk_idpaiss` (`pais`),
  KEY `fk_numids` (`numid`),
  CONSTRAINT `fk_idciudads` FOREIGN KEY (`ciudad`) REFERENCES `np_ciudades` (`id_ciudad`),
  CONSTRAINT `fk_idpaiss` FOREIGN KEY (`pais`) REFERENCES `np_paises` (`id_pais`),
  CONSTRAINT `fk_numids` FOREIGN KEY (`numid`) REFERENCES `nm_nits` (`numid`)
) ENGINE=InnoDB AUTO_INCREMENT=3104 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='Sucursales';
/*!40101 SET character_set_client = @saved_cs_client */;

